// conteudosPorSecao.js
const context = require.context("./", false, /\.json$/);

export const conteudosPorSecao = context.keys().reduce((acc, path) => {
  const nome = path.replace("./", "").replace(".json", "");
  acc[nome] = context(path);
  return acc;
}, {});
